import React from 'react';
import Menu from './Menu';
import imgFundo from '../img/fundo.jpg';
import Imagem from './Imagem';

export default function Home() {

    return(
    <>
        <Menu/>
        <Imagem nomeImage={igFundo}/>
    </>
        
    );
}
